import React, { useRef, useEffect, useState } from "react";
import PlayCircleRoundedIcon from '@mui/icons-material/PlayCircleRounded';
import Grid from '@mui/material/Grid';
import '../css/navbar.css';
import axios from 'axios';
import { useNavigate } from "react-router-dom";
import ListTrending from './listrending';
import slugify from "./utils/slugify";
import NavBar from './navbar';
import HomeIcon from '@mui/icons-material/Home';
import { Link } from "react-router-dom";
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';
import TablePagination from '@mui/material/TablePagination';

function PhimLe() {
  const [moviesle, setMovieLe] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios.get('http://localhost:8080/website/movieLe')
      .then(response => {
        setMovieLe(response.data);
      })
      .catch(error => console.error(error));
  }, []);

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(20);

  // const [snackbarOpen, setSnackbarOpen] = useState(false)

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  return (
    <div>
      <NavBar />
      <br></br>
      <div className="content">
        <div className="link">
          <HomeIcon color="primary" sx={{ color: "#8B4513", fontSize: 25 }} />
          <Link to="/home" className="xemphim">Xem phim</Link> / Phim lẻ
        </div>
        <div className="grid">
          <div className="grid__item grid__item_item4">
            <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
              {Array.isArray(moviesle) && moviesle.length > 0 ? (
                moviesle.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((moviele, index) => (
                  <Grid item xs={3} key={index}>
                    <div className="card"
                      onClick={() =>
                        navigate(`/film/${slugify(moviele.name)}`, {
                          state: { id: moviele.id },
                        })
                      }
                    >
                      <a href="">
                        <div className="img1">
                          <img
                            src={`data:image/jpeg;base64,${moviele.image}`}
                            alt={moviele.name}
                            style={{
                              width: "100%",
                              height: "100%",
                              objectFit: "cover",
                              borderRadius: "8px",
                            }}
                          />
                        </div>
                        <div className="title">{moviele.name}</div>
                        <div className="text">Full Vietsub</div>
                        <div className="catagory">Phát hành năm: {moviele.namphathanh} </div>
                        <div className="icon_video">
                          <PlayCircleRoundedIcon sx={{ width: 60, height: 60 }} />
                        </div>
                        <div className="views">{moviele.duration} phút</div>
                      </a>
                    </div>
                  </Grid>
                ))
              ) : (
                <TableRow>
                  <TableCell colSpan={3} align="center">Loading...</TableCell>
                </TableRow>
              )}

  
            </Grid>
            <TablePagination
              rowsPerPageOptions={[20]}
              component="div"
              count={moviesle != null ? moviesle.length : 0}
              rowsPerPage={rowsPerPage}
              page={page}
              onPageChange={handleChangePage}
              onRowsPerPageChange={handleChangeRowsPerPage}
            />
          </div>
          <div className="grid__item grid__item_item5">   <ListTrending /></div>
        </div>
      </div>
    </div>
  );
}

export default PhimLe;
